import React from 'react'
import { useState,useEffect } from 'react'
import {MovieAPIKey} from '../../API/MovieAPIKey'
import MovieAPI from '../../API/MovieAPI'
import MovieCard from './MovieCard'
import NotesList from '../pages/NotesList'


const MoviesList = (props) => {


    if(props.searchData){
        const MovieData = props.searchData;
        const RenderMovies = MovieData.map((each) => {
            return(
                <div>
                    <MovieCard movieData={each}/>
                </div>
            );
        })


        return(
            <div style={{margin:"4%",maxWidth:"100%","display":"grid","gridTemplateColumns": "repeat(auto-fit, minmax(300px, 1fr))"}}>
                {RenderMovies}
            </div>
        );
    }

    else{
        return(<div align="center"><h1>No Data to Display</h1></div>);   
    }
}
export default MoviesList;
